import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Body() {
  return (
    <div className="jumbotron">
      <Container>
        <Row>
          <Col>
            <h2>Dhriti </h2>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Body;
